raw_question: What are the first, middle, and last names for everybody enrolled in a Bachelors program? 
question_index: 536 
constants:
 - Bachelor
join_columns:
 - student_id
 - degree_program_id
columns:
 - degree_summary_name
filters:
 - '='
comment: |-
  SELECT DISTINCT T1.first_name,
                  T1.middle_name,
                  T1.last_name
  FROM Students AS T1
  JOIN Student_Enrolment AS T2 ON T1.student_id = T2.student_id
  JOIN Degree_Programs AS T3 ON T2.degree_program_id = T3.degree_program_id
  WHERE T3.degree_summary_name = 'Bachelor'

sql: |-
  SELECT DISTINCT T1.first_name,
                  T1.middle_name,
                  T1.last_name
  FROM Students AS T1
  JOIN Student_Enrolment AS T2 ON T1.student_id = T2.student_id
  JOIN Degree_Programs AS T3 ON T2.degree_program_id = T3.degree_program_id
  WHERE T3.degree_summary_name = 'Bachelor'
